You need to implement the following methods:
1. `AtualizarItemCarrinho`: Updates the quantity or other properties of a specific item in the shopping cart. The steps for this method are detailed in the provided diagram.
2. `Remover`: Removes a specific product from the shopping cart for a given user. The steps for this method are detailed in the provided diagram.
3. `AtualizarCarrinho`: Updates the entire shopping cart with a new set of items. The steps for this method are detailed in the provided diagram.
4. `RemoverTodosItens`: Clears all items from the shopping cart for a given user. The steps for this method are detailed in the provided diagram.

Your implementation should handle any necessary error checking and ensure that the shopping cart is updated accurately and efficiently.

