```csharp
using System;
using System.Collections.Generic;
using System.Threading.Tasks;

public class ShoppingCartService : IShoppingCartService
{
    public async Task AtualizarItemCarrinho(Models.ItemCarrinho item, Carrinho carrinho)
    {
        // Check if item or carrinho is null
        if (item == null || carrinho == null)
        {
            throw new ArgumentNullException("item and carrinho cannot be null");
        }

        // Find the item in the cart and update its properties
        var existingItem = carrinho.Items.Find(i => i.ProductId == item.ProductId);
        if (existingItem != null)
        {
            existingItem.Quantity = item.Quantity;
            // Update other properties as needed
        }
        else
        {
            // Handle case where the item is not found in the cart
            throw new InvalidOperationException("Item not found in the cart");
        }
    }

    public async Task Remover(string produto, string user)
    {
        // Check if produto or user is null or empty
        if (string.IsNullOrEmpty(produto) || string.IsNullOrEmpty(user))
        {
            throw new ArgumentException("produto and user cannot be null or empty");
        }

        // Find and remove the specified product from the user's cart
        var itemToRemove = carrinho.Items.Find(i => i.ProductId == produto);
        if (itemToRemove != null)
        {
            carrinho.Items.Remove(itemToRemove);
        }
        else
        {
            // Handle case where the item is not found in the cart
            throw new InvalidOperationException("Item not found in the cart");
        }
    }

    public async Task AtualizarCarrinho(Carrinho carrinho)
    {
        // Check if carrinho is null
        if (carrinho == null)
        {
            throw new ArgumentNullException("carrinho cannot be null");
        }

        // Update the entire shopping cart with the new set of items
        // Assuming carrinho.Items is a list that can be replaced
        carrinho.Items = new List<Models.ItemCarrinho>(carrinho.Items);
    }

    public async Task RemoverTodosItens(string usuario)
    {
        // Check if usuario is null or empty
        if (string.IsNullOrEmpty(usuario))
        {
            throw new ArgumentException("usuario cannot be null or empty");
        }

        // Clear all items from the user's shopping cart
        carrinho.Items.Clear();
    }
}
```

