impl<'a> Iterator for UsersIter<'a> {
    type Item = User; // Assuming User is the type of elements in the iteration

    fn next(&mut self) -> Option<Self::Item> {
        if let Some(c) = self.channel {
            if let Some(user) = self.channels[c].next() {
                return Some(user);
            } else {
                for i in c + 1..self.channels.len() {
                    if let Some(user) = self.channels[i].next() {
                        self.channel = Some(i);
                        return Some(user);
                    }
                }
                self.channel = None;
                None
            }
        } else {
            None
        }
    }
}
```

