def fibonacci_iterative(n):
    if n <= 0:
        return 0
    elif n == 1:
        return 1

    a, b = 0, 1
    for _ in range(2, n + 1):
        a, b = b, a + b

    return b
```

The `fibonacci_iterative` function efficiently calculates the nth number in the Fibonacci sequence using an iterative approach. It initializes `a` and `b` to 0 and 1, respectively, and then iterates through a range from 2 to `n`, updating `a` and `b` in each iteration to calculate the next number in the sequence. Finally, it returns the value of `b`, which represents the nth number in the Fibonacci sequence. This approach ensures efficient computation for large values of `n` by avoiding redundant recursive calls.

