First, let us express the diagonal of the base as a vector:

{eq}\overrightarrow{a} = 11\hat{x} + 7\hat{y}

{/eq}

Now, we express the {eq}\text{7'' 2''}{/eq} diagonal as a vector:

{eq}\overrightarrow{b} = 7\hat{y} + 2\hat{z}

{/eq}

Next, we find the magnitude of both vectors:

{eq}\begin{align}

|\overrightarrow{a}| &= \sqrt{11^2+7^2} \\

&= 13.038 \\

|\overrightarrow{b}| &= \sqrt{7^2+2^2} \\

&= 7.280

\end{align}

{/eq}

Now, we take the dot product of both vectors:

{eq}\begin{align}

\overrightarrow{a}  \cdot \overrightarrow{b} &= (11*0) + (7*7) + (0*2) \\

&= 49

\end{align}

{/eq}

Finally, we plug in the dot product magnitudes of our vectors into our relation to find the angle between them:

{eq}\begin{align}

\overrightarrow{a}  \cdot \overrightarrow{b} &= |\overrightarrow{a}| |\overrightarrow{b}| cos(\theta) \\

49 &= 13.028*7.280 \  cos(\theta) \\

0.5166 &= cos(\theta) \\

58.89^o &\approx \theta

\end{align}

{/eq}

So, the angle between the diagonal of the base and the diagonal of the {eq}\text{7'' 2''}{/eq} side is approximately {eq}\boxed{58.89^o}

